  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes the total number
  of Federal Firearms Licensees (FFL) for the years 1975 to 2014. The totals include:
  dealers; pawnbrokers; collectors; manufacturers of firearms; manufacturers of ammunition;
  importers; and dealers, manufacturers, and importers of destructive devices. This
  data is sourced from the ATF Federal Firearms Licensing Center, Federal Licensing
  System (FLS). Data is based on active firearms licenses and related statistics as
  of the end of each fiscal year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
